✨I had 20 Photographers edit the same photo… this is how it went! ✨

One of my favourite things about this job is the incredible community of other photographers! Those who see other photographers as community and not competition are people who support each other, boast each other and share tips, advice and help and they come through when you have an idea for a reel and they edit this photo the same day!

I LOVE seeing this trend of the same photo edited by multiple photographers so I had to reach out to my close group of photographers and have them all edit my image from a recent wedding and I was blown away so much more than I ever expected too be! Art is so subjective and no art is right or wrong it’s all an incredible interpretation of what they see! I always picture an original image the same as a blank canvas, the second part of the art process is the post production and that’s where it starts to create an identity specific to that photographer!

This is also a HUGE part of why I never see my friends and photographers as competition! Yes we may have similar ways of shooting and working with our clients, however we are all so unique with the finaloutcome due to editing the we are so set apart! Every client has a vision for what they want so if they want light and airy or dark and moody etc etc then I would never be offended if a client chose someone else over me!

Anyways, enjoy this INCREDIBLE collage of unique styles and editing by my insanely talented friends!

Here are there Instagram pages, you should check them all out! <3

